import Logo from './Logo';

function NavLinks({}) {
    const navLinks = [
        { href: "#about", label: "About" },
        { href: "#experience", label: "Experience" },
        { href: "#projects", label: "Projects" },
        { href: "#contact", label: "Contact" },
    ];

    return (
      <div>
        {/* Desktop Navigation */}
          <ul className="flex gap-8 list-none text-2xl text-white">
            {navLinks.map((link) => (
              <a key={link.href} href={link.href}>
                <span className="hover:text-gray-400 hover:underline-offset-16 text-black">
                  {link.label}
                </span>
              </a>
            ))}
          </ul>
        {/* Mobile Navigation */}
      </div>
    );
}

export default NavLinks;
